import React from 'react';
import './../../styles/_SignUp.scss';

const SignUp = (props) => {
    return (
        <div id="sign-up-button" className="dropdown">
            <button className="btn btn-lg font-weight-semi-bold mx-2 ml-sm-0 px-5"
                    style={{backgroundColor: props.Background}}>
                Sign up
            </button>
        </div>
    );
}

export default SignUp;
